function generate_links(){
    /*retreives filters from the textbox, and seperates them into an array*/
    var raw_text = document.getElementById("city_filters").value;
    let text_manipulated = raw_text;
    let seperated_filters = [];
    let loop = true;
    while (loop == true){
        let space_location = text_manipulated.search(" ");
        if (space_location < 0){
            seperated_filters.push(text_manipulated);
            break
        }
        else{
            seperated_filters.push(text_manipulated.slice(0,space_location));
            text_manipulated = text_manipulated.slice(space_location+1,text_manipulated.length);
        }
    }
    console.log(seperated_filters);
    /*sets the database based on age preference inputs*/
    var age_range = ""
    var gender = ""
    if(document.getElementById('younger').checked == true){if(document.getElementById('older').checked == false){
        age_range = "younger";
        console.log('younger');
    }}
    if(document.getElementById('younger').checked == false){if(document.getElementById('older').checked == true){
        age_range = "older";
        console.log('older');
    }}

    /*connects program to random database when both ages are checked*/
    if(document.getElementById('younger').checked == document.getElementById('older').checked){
        var age_select = Math.floor(Math.random() * 2)
        console.log(age_select)
        if(age_select == 0){
            age_range = "younger";
            console.log('younger');}
        if(age_select == 1){
            age_range = "older";
            console.log('older');}
    }
    /*selects randome name from the list*/
    var gender_select = Math.floor(Math.random() * 2)
    if(gender_select == 0){
        gender = "female";
        console.log('female');
    }
    if(gender_select == 1){
        gender = "male"
        console.log('male');
    }
    var name = eval(age_range + "_" + gender);
    console.log(name)
    var array_length = name.length
    var index_num = Math.floor(Math.random() * (array_length + 1));
    console.log(array_length);
    console.log(index_num);
    console.log(name[index_num])
    /*composes link from the name and area filters, then displayes the link and opens the link to a new tab when settings allow*/
    var compile_links = "<ul>";
    var links_to_open = [];

    for (let city in seperated_filters){
        var link = "https://www.facebook.com/search/people?q=" + name[index_num] + (seperated_filters[city]);
        compile_links += "<a href='"+ link + "' target='_blank'><li>"+ link +"</li><a>";
        if(document.getElementById('auto_open').checked == true){window.open(link);}
    }

    compile_links += "</ul>"
    document.getElementById("results").innerHTML = compile_links;
}